            <h1>Create forms easily</h1>
            <h5>Create forms easily to collect meaningful data and scale your business and school.</h5>
            <div>
                <Link to="/formcreation"><button className='p-2 btn bg-white text-dark'>Create Form</button></Link>
                <Link to="/pricing"><button className='p-2 btn rounded bg-white text-dark'>Pricing</button></Link>
            </div>  

            <div>
                <img src="" alt="" />
            </div>
        </div>
        </>
    )
}
